import Card from "../components/Card";
import "./Reviews.css"

const Reviews = () => {
  function createCards(data) {
    cardOneIdx = Math.floor(Math.random() * 10);
    cardTwoIdx = Math.floor(Math.random() * 10);
    cardThreeIdx = Math.floor(Math.random() * 10);
    while (cardOneIdx == cardTwoIdx || cardTwoIdx == cardThreeIdx) {
      console.log(cardOneIdx,cardTwoIdx, cardThreeIdx)
      cardOneIdx = Math.floor(Math.random() * 10);
      cardTwoIdx = Math.floor(Math.random() * 10);
      cardThreeIdx = Math.floor(Math.random() * 10);
    }
    console.log(cardOneIdx,cardTwoIdx, cardThreeIdx)
  }

  return <div id="reviews-container">
    <Card />
  </div>
}

export default Reviews;
